export default function inordertraversal ( callback, node ) {

	if ( node.left !== null ) {
		inordertraversal( callback, node.left );
	}

	callback( node.value );

	if ( node.right !== null ) {
		inordertraversal( callback, node.right );
	}

}

export default function insert ( compare, A, B ) {

	let node = null;
	const value = B.value;

	while ( true ) {

		if ( compare( value, A.value ) <= 0 ) {

			node = A.left;

			if ( node === null ) {
				A.left = B;
				break;
			}

			A = node;

		}

		else {

			node = A.right;

			if ( node === null ) {
				A.right = B;
				break;
			}

			A = node;

		}

	}

	return B;

}

export default function insertwithparent ( compare, A, B ) {

	let node = null;

	while ( true ) {

		if ( compare( B, A ) <= 0 ) {

			node = A.left;

			if ( node === null ) {
				A.left = B;
				break;
			}

			A = node;

		}

		else {

			node = A.right;

			if ( node === null ) {
				A.right = B;
				break;
			}

			A = node;

		}

	}

	B.parent = A;

	return B;

}

/**
